import React from 'react';
import { Landing } from './Components/Login.js';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { MDBContainer } from 'mdb-react-ui-kit';


function App() {
  return (
    <Router>
      <MDBContainer className="border border-primary mt-5">
        <div className="row row-cols-2">
          <div className="col border border-secndary">
            <h1>Aqu√≠ va la imagen </h1>
          </div>
          <div className="col">

              <Switch>
                <Route path="/">
                  <Landing />
                </Route>
              </Switch>
          </div>
        </div>
      </MDBContainer>
    </Router>
  );
}

export default App;
